    server = remote("crypto.ctf.umasscybersec.org", 7000)

    server.recvuntil(b"Select an option: ")
    server.sendline(b"3")
    encrypted_flag = bytes.fromhex(server.recvline().decode().strip())
    print("Encrypted flag:", encrypted_flag)

    plaintext = b"A" * len(encrypted_flag)  # match flag length

    samples = []
    if precomputed_samples is not None:
        samples = precomputed_samples

    # We need to get all 256 different possible offset
    while len(set(samples)) != 256:
        with tqdm(desc="") as pbar:
            server.recvuntil(b"Select an option: ")
            server.sendline(b"2")
            server.recvuntil(b"Enter a string to encrypt: ")
            server.sendline(plaintext)
            samples.append(bytes.fromhex(server.recvline().decode().strip()))
            pbar.set_description(f"Unique samples: {len(set(samples))}")
            pbar.update(1)

    print("Samples:", set(samples))
    for sample_index, sample in enumerate(samples):
        possible_flag = []
        for i in range(len(sample)):
            key_byte = sample[i] ^ plaintext[i]
            possible_flag.append(encrypted_flag[i] ^ key_byte)
        possible_flag = "".join(map(chr, possible_flag))
        if "UMASS{" in possible_flag:
            print(f"[{sample_index}]={possible_flag}")
